import React, { useState, useEffect } from 'react';
import AppelOffreService from '../services/AppelOffreService';

const DashboardAppelOffreComponent = () => {
    const [appelOffresData, setAppelOffresData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    // Charger les données au montage du composant
    useEffect(() => {
        fetchDashboardData();
    }, []);

    // Fonction pour récupérer les données
    const fetchDashboardData = async () => {
        try {
            const response = await AppelOffreService.getdashboard();
            setAppelOffresData(response.data);
        } catch (err) {
            console.error("Erreur lors de la récupération des données :", err);
            setError("Une erreur est survenue lors de la récupération des données.");
        } finally {
            setLoading(false);
        }
    };

    // Calcul des totaux
    const calculateTotal = (key) => {
        return appelOffresData.reduce((sum, row) => sum + (row[key] || 0), 0);
    };

    return (
        <div className="container-fluid">
            <h2 className="text-center mt-4 mb-4">Tableau de Bord - Appels d'Offres</h2>

            {loading ? (
                <p className="text-center">Chargement des données...</p>
            ) : error ? (
                <p className="text-danger text-center">{error}</p>
            ) : (
                <div className="table-responsive">
                    <table className="table table-bordered table-striped">
                        <thead className="table-dark">
                            <tr>
                                <th>Entité</th>
                                <th className="text-center">Appels d'offres à lancer</th>
                                <th className="text-center">Appels d'offres transmis au CE</th>
                                <th className="text-center">Appels d'offres lancés</th>
                                <th className="text-center">Appels d'offres jugés</th>
                            </tr>
                        </thead>
                        <tbody>
                            {appelOffresData.map((row, index) => (
                                <tr key={index}>
                                    <td>{row.entite}</td>
                                    <td className="text-center">{row.appelOffresALancer}</td>
                                    <td className="text-center">{row.appelOffresTransmisCe}</td>
                                    <td className="text-center">{row.appelOffresLance}</td>
                                    <td className="text-center">{row.appelOffresJuge}</td>
                                </tr>
                            ))}
                        </tbody>
                        <tfoot className="table-secondary">
                            <tr>
                                <td><strong>Total</strong></td>
                                <td className="text-center"><strong>{calculateTotal('appelOffresALancer')}</strong></td>
                                <td className="text-center"><strong>{calculateTotal('appelOffresTransmisCe')}</strong></td>
                                <td className="text-center"><strong>{calculateTotal('appelOffresLance')}</strong></td>
                                <td className="text-center"><strong>{calculateTotal('appelOffresJuge')}</strong></td>
                            </tr>
                        </tfoot>
                    </table>
                </div>
            )}
        </div>
    );
};

export default DashboardAppelOffreComponent;
